import React from 'react';
import PropTypes from 'prop-types';

TodoList.propTypes = {
  listTodo: PropTypes.array
}

TodoList.defaultProps = {
  listTodo: []
}

function TodoList(props) {
  const { task } = props
  return (
    <div>
      <ul>
        {
          task.map(item => {
            return <li key={item.id}>{item.task}</li>
          })
        }
      </ul>
    </div>
  )
}

export default TodoList;
